import { useEffect, useState } from "react";

import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";

import { useParams } from "react-router-dom";

import { toast } from "react-toastify";
import { editEmpDetails } from "./services/user";
import { Link, useNavigate } from "react-router-dom";


import { updateEmp as updateEmpApi } from "./services/user";
import { log } from "./utils/utils";

// import image from './images/im.avif';

function Profile() {

    const navigate = useNavigate();

    //const { branchId } = useParams();

    const [profile, setProfile] = useState({
      customerId: "",
      firstName: "",
      lastName: "",
      email: "",
      password: "",
      mobile:"",
      gender:""
    });

    const getProfileDetailsToEdit = async (customerId) => {
      const response = await editcustomerDetails(customerId);
      debugger;
      if (response !== null) {
        setBranch(response);
      } else {
        toast.error("something went wrong ");
      }
    };

    useEffect(() => {
      getProfileDetailsToEdit(customerId);
      debugger;
    }, []);

    const updateProfile = async () => {
      debugger;

      if (profile.firstName.length == "") {
        toast.error("Please enter first name");
      } else if (profile.lastName.length == "") {
        toast.error("Please enter last name");
      } else if (profile.email.length == "") {
        toast.error("Please enter email");
      } else if (branch.password.length == "") {
        toast.error("Please enter password ");
      } else {
        const response = await updateBranchApi(
          profile.customerId,
          profile.firstName,
          profile.lastName,
          profile.email,
          profile.password,
          profile.mobile,
          profile.gender
        );
        debugger;
        if (response) {
          debugger;
          toast.success("Successfully profile update");
          log(response.data);
          // go back to login
          navigate("/admin");
        } else {
          toast.error("Error while registering a  user, please try again");
        }
      }
    };

  return (
    <>
      <center>
        {/* <div style={{backgroundImage:`url(${image})`}} >  */}
        <div className="length">
          <div className="myTable">
            <div className="form-group">
              <table>
                <tr>
                  <td className="fa">Enter firstname</td>
                  <td>
                    <input
                      type="text"
                      required
                      className="form-control"
                      name="firstname"
                      placeholder="Enter Firstname"
                    />
                  </td>
                  <td className="td"></td>

                  <td className="fa">Enter lastname </td>
                  <td>
                    <input
                      type="text"
                      required
                      className="form-control"
                      name="lastname"
                      placeholder="Enter Lastname"
                    />
                  </td>
                </tr>

                <tr className="tr"></tr>

                <tr>
                  <td className="fa">Enter Email</td>
                  <td>
                    {" "}
                    <input
                      type="text"
                      required
                      className="form-control"
                      name="email"
                      placeholder="Enter Email"
                    />
                  </td>
                  <td className="td"></td>
                  <td className="fa">Enter Mobile</td>

                  <td>
                    <input
                      type="text"
                      required
                      className="form-control"
                      name="mobile"
                      placeholder="Enter Mobile number"
                    />
                  </td>
                </tr>

                <tr className="tr"></tr>

                <tr>
                  <td className="fa">Enter Password</td>
                  <td>
                    <input
                      type="password"
                      required
                      className="form-control"
                      name="password"
                      placeholder="Enter password"
                    />
                  </td>
                  <td className="td"></td>
                  <td className="fa">Enter Gender</td>
                  <td>
                    <select name="role">
                      <option value="Select">Select Role</option>
                      <option value="">Male</option>
                      <option value="">Female</option>
                    </select>
                  </td>
                </tr>
              </table>
            </div>
            <tr className="tr"></tr>


            <hr></hr>

            <button className="btn btn-primary">Update Record</button>
          </div>
        </div>
      </center>
    </>
  );
}

export default Profile;
